};

var n_bodies = 4
var positions = []
var velocities = []
for(var i = 0; i < n_bodies; i++) {
  var theta = i*Math.PI*2./n_bodies
  var radius = 3.;
  var x = Math.cos(theta)*radius
  var z = Math.sin(theta)*radius
  var vx = Math.cos(theta+Math.PI/2.)
  var vz = Math.sin(theta+Math.PI/2.)

  positions.push([x, 0., z, 1.])
  velocities.push([vx, 0., vz, 0.])
}

function render_callback() {
  if(!window.startTime) window.startTime = new Date().getTime()
  var new_time = (new Date().getTime()-window.startTime)/1E3;
  window.delta_time = new_time-window.time_elapsed
  window.time_elapsed = new_time

  positions.forEach((pos, index)=>{
    vec4.scaleAndAdd(pos, pos, velocities[index], window.delta_time)
  })

  velocities.forEach((vel1, index1)=>{
    var force_gravity = [0,0,0,0];
    var pos1 = positions[index1]
    var mass1 = pos1[3]
    // Fg = G*m1*m2/r/r
    const G = 3.;
    velocities.forEach((vel2, index2)=>{
      if(index2 == index1) return;
      var pos2 = positions[index2]
      var mass2 = pos2[3]
      var delta = vec4.sub(vec4.create(), pos2, pos1)
      var normal = vec4.normalize(vec4.create(), delta)
      var radius = vec3.length(delta)
      vec3.scaleAndAdd(force_gravity, force_gravity, normal, mass1*mass2/radius/radius)
    })
    vec3.scaleAndAdd(vel1, vel1, force_gravity, G*window.delta_time)
  })
}

